$(document).ready(function () {
    let isMuted = false;  // حالة الصوت: افتراضيًا غير مكتوم

    // عند الضغط على الأيقونة
    $('#volume-icon').on('click', function () {
        if (isMuted) {
            // إذا كان الصوت مكتومًا، قم بإلغاء كتم الصوت
            isMuted = false;
            $(this).removeClass('fa-volume-mute').addClass('fa-volume-up');
            // يمكنك هنا إضافة الكود لتشغيل الصوت أو أي إجراء آخر
            console.log("تشغيل الصوت");
        } else {
            // إذا كان الصوت غير مكتوم، قم بكتم الصوت
            isMuted = true;
            $(this).removeClass('fa-volume-up').addClass('fa-volume-mute');
            // يمكنك هنا إضافة الكود لكتم الصوت أو أي إجراء آخر
            console.log("كتم الصوت");
        }
    });
});
